import { useState } from 'react';
import firebase from './firebase';

function App() {
  const [teams, setTeams] = useState([]);
  return (
    <div>
      <ul>
        {teams.map((team) => {
          return (
            <li>
              <p>{team}</p>
            </li>
          )
        })}
      </ul>
    </div>
  );
}

export default App;
